sources.components/utils/scss/variables.scss:
$primaryBtn: rgba(32, 108, 223, 0.918);
$primaryHoverBtn: rgb(20, 82, 173);
$white: rgba(255,255,255,1);

// PADDING
$small-spacing: 10px;
$medium-spacing: 15px;
$large-spacing: 20px;

// BACKGROUND
// WHITE
$white-bg: rgba(255, 255, 255, 1);

// GREY
$dark-bg: rgba(53, 53, 53, 1);
$dark-clear-bg: rgb(156, 156, 156);
$dark-light-bg: rgb(236, 236, 236);
// INDIGO 
$indigo-light: #666ad1;
$indigo-neutral: #303f9f;
$indigo-dark: #001970;
// CYAN
$cyan-light: #56c8d8;
$cyan-neutral: #0097a7;
$cyan-dark: #006978;
// BLUE
$blue-light: #63a4ff;
$blue-neutral: #1976d2;
$blue-dark: #004ba0;

sources.components/utils/scss/action.scss:
button {
    &.primary {
        background-color: $primaryBtn;
        color: $white;
        &:hover {
            background-color: $primaryHoverBtn;
            color: $white;
        }
    }
    &.bt-border {
        border: 0;
        border-bottom: 1px solid $dark-light-bg;
    }
    &.rounded-btn {
        border-radius: 20px;
    }
}

a {
    color: $dark-bg;
    transition: all .3s ease-in-out;
    &:not(.no-hover){
        &:hover{
            color: $dark-clear-bg;
        }
    }
    &.rounded {
        border-radius: 5px;
    }
    &.primary {
        background-color: $primaryBtn;
        color: $white;
    }
}

sources.components/utils/scss/color-codes.scss:
@mixin colorWhite {
    color: $white;
}

// GREY / BLACK
.dark-bg {
    background-color: $dark-bg;
    @include colorWhite;
}
.dark-clear {
    background-color: $dark-clear-bg;
}
.dark-light {
    background-color: $dark-light-bg;
    color: $dark-bg;
}

// INDIGO
.indigo-light {
    background-color: $indigo-light;
    @include colorWhite;
}
.indigo-neutral {
    background-color: $indigo-neutral;
    @include colorWhite;
}
.indigo-dark {
    background-color: $indigo-dark;
    @include colorWhite;
}
// BLUE
.blue-light {
    background-color: $blue-light;
    @include colorWhite;
}

sources.components/utils/scss/flex.scss:
@mixin flrow {
    flex-direction: row;
}
@mixin flcolumn {
    flex-direction: column;
}

@mixin dflex-row {
    display: flex;
    @include flrow;
}
@mixin dflex-column {
    display: flex;
    @include flcolumn;
}


.d-flex {
    @include dflex-row;
    &.js-between {
        justify-content: space-between;
    }

    &.fl-column {
        flex-direction: column;
    }

    &.align-center {
        align-items: center;
    }
}

sources.components/utils/scss/form.scss:
@mixin InputBorder {
    border-radius: 10px;
}
.form-group {
    .group-input {
        @include dflex-column;
        &.pos-r {
            position: relative;
            .input-float {
                label {
                    &.custom-label{
                        position: absolute;
                        opacity: 0;
                        z-index: -1;
                        transform-origin: top left;
                        transform: translate(10px, 6px) scale(1,2);
                        transition: all .3s ease-in-out;
                        &.active {
                            opacity: 1;
                            z-index: 0; 
                            transform: translate(10px, -10px) scale(.75);
                        }
                        &.active + input::-webkit-input-placeholder {
                            opacity: 0;
                            transition: all .3s ease-in-out;
                        }

                    }
                }
                .input-field {
                    @include InputBorder;
                    border: 1px solid $dark-light-bg;
                    height: 38px;
                    outline: none;
                    width: 100%;
                }
            }
        }
    }
}

